        <!-- Stylesheet -->
        <link rel="stylesheet" type="text/css" href="style/main.css">
        <link rel="stylesheet" type="text/css" href="style/mdb.min.css">
        <link rel="stylesheet" type="text/css" href="style/fontawesome.min.css">

        <!-- Fonts -->
        <link rel="preconnect" href="https://fonts.gstatic.com">

<style>
        
* {
    box-sizing: border-box;
    margin: 0;
    padding: 0;
  }
  
  header {    
    display: flex;
    justify-content: space-between;
    align-items: center; 
    padding: 15px 10%; 
    background-color: #EBF3F8;
    box-shadow: 0 4px 2px -2px gray;
  }
  

  .cta {
    padding: 7px 40px;
    background-color:rgba(183, 211, 227, 0.86);
    border: 2px solid #2C5A7C;
    border-radius: 2em;
    cursor: pointer;
    transition: background-color 0.3s ease 0s;
    color:#2C5A7C;
    margin-left: 30px;
    font-family: 'Roboto', sans-serif;
    font-weight: 400;
  }
  
  .cta:hover {
    background-color: rgba(0, 136, 169, 0.8);
  }
  
  .logo {
      margin-top: 5px;
      text-decoration: none;
      color: 3A7CA5;
      font-family:'Lucida Sans', 'Lucida Sans Regular', 'Lucida Grande', 'Lucida Sans Unicode', Geneva, Verdana, sans-serif;
  }

  a:hover {
    color: rgba(0, 136, 169, 1);
  }


  body {
      background-color: #81C3D7;
      overflow: hidden;
  }

  .right {
      float: right
  }
  
  .sell {
      text-decoration: underline;
      color: #2C5A7C;
  }

  .font {
    font-family: 'Roboto', sans-serif;
  }

  .notifs {
      padding-left: 30px;
      margin-bottom: 10px;
  }

  .menu {
      width: 18%;
      float: left;
      height: calc(100vh - 3em);
      background-color: #EBF3F8;
  }

  .listings {
      width: 82%; 
      height: calc(100vh - 3em);
      float: right;
      padding: 6em 8em; 
  }

  .category {
      color: #5C6D7D;
      font-weight: 500;
      font-size: 20px; 
      padding-left: 50px; 
      margin-bottom: 10px;
  }

  .item {
    color: rgba(92,109,125, 0.6);
    font-weight: 400;
    font-size: 16px; 
    padding-left: 50px; 
    margin-bottom: 3px;
  }

  #selected {
      border-left: 6px solid #5C6D7D;
      padding-left: 44px;
      color: #5C6D7D;
  }

  .top-bar {
    color: #EBF3F8;
    margin-bottom: 20px; 
  }

  .subtitle {
      font-size: 25px; 
      font-weight: 500; 
  }

  .subcat {
      font-size: 16px; 
      text-decoration: underline;
      font-weight: 400; 
  }

  .filter {
      float: right; 
      border: none;
      outline: none;
      border-radius: 20px; 
      padding: 2px 20px 2px 20px; 
  }

  .items {
      display: flex; 
      flex-direction: row; 
      height: 100vh; 
      flex-wrap: wrap;
  }

  .card {
      height: 500px; 
      width: 400px; 
      background-color: rgba(235, 243, 248, 0.8);
      border-radius: 20px; 
      color: #16425B;
      margin-top: 2em;
  }

  .item-name {
      font-weight: 500;
      font-size: 16px;
      padding-left: 20px; 
  }

  .item-price 
  {
    font-weight: 400;
    font-size: 14px;
    padding-left: 20px; 
  }

  .title 
  {   
    color: #EBF3F8; }

.list-item
{
    margin-top: 2em;
}

.list-item-desc
{
    margin-top: 2.5em;
}

.center
{
    display: flex;
    justify-content: center;
}

.contact-div
{
    display: block;
    float: right;
    margin-top: -12em;
    margin-right: 17em;


}

.contact
{
    padding: 7px 40px;
    background-color:rgba(183, 211, 227, 0.86);
    border: 2px solid #2C5A7C;
    border-radius: 2em;
    cursor: pointer;
    transition: background-color 0.3s ease 0s;
    color:#2C5A7C;
    margin-top: 10px;
    font-family: 'Roboto', sans-serif;
    font-weight: 400;

}
</style>
